"Deze app ('Live TV-app') wordt door iWedia S.A. aangeboden onder een eenmalige, niet-exclusieve, niet-overdraagbare, royaltyvrije, niet-sublicentieerbare en herroepbare licentie ('Evaluatielicentie') die uitsluitend mag worden gebruikt voor interne evaluaties en demonstraties gedurende 6 maanden vanaf de releasedatum van de Live TV-app.

De Evaluatielicentie wordt uitsluitend verleend voor de volgende doeleinden: 

I. Interne evaluatie: Deze licentie is uitsluitend bestemd voor intern gebruik en is geen productielicentie. Deze licentie mag niet worden gedistribueerd, niet in zijn geheel, noch onderdelen ervan, noch geïntegreerd in wat voor commercieel product dan ook

II. Demonstratie: Naast interne evaluatie mag deze licentie in deze vorm ook voor marketingdoeleinden worden gebruikt, namelijk voor demonstraties aan derden. Het is expliciet verboden om deze licentie op wat voor manier dan ook te gebruiken voor concurrenten van iWedia.

Het volgende is verboden:

I. Sublicenties verlenen om de Live TV-app te gebruiken of aan te passen, of om afgeleide werken te maken van de Live TV-app, inclusief eventuele gerelateerde documentatie;

II. De objectcode of broncode van de Live TV-app (of de achterliggende ideeën, algoritmen, structuur of ordening) gedeeltelijk of geheel decompileren, onderwerpen aan reverse engineering, disassembleren, opnieuw formatteren, benchmarken of op andere wijze proberen te lezen of leesbaar te maken;

III. De Live TV-app wijzigen of een afgeleid werk van de Software maken;

IV. Rechten in de Live TV-app verhuren, leasen, verkopen, er sublicenties voor verlenen, er een veiligheidsbelang aan toekennen of op een andere manier overdragen;

V. Markeringen, kennisgevingen of labels in de Live TV-app die het eigendom aanduiden verwijderen of wijzigen;

VI. De Live TV-app gebruiken op een manier die het intellectueel eigendom of de privacyrechten van een derde partij schendt; of

VII. De Live TV-app gebruiken op een manier die toepasselijke internationale, federale, staats- of lokale wet- en regelgeving schendt.

Alle rechten, titels en belangen met betrekking tot intellectueel eigendom en eigendomsrechten voor de Live TV-app blijven van iWedia.

